div.div:
Get answer from cache
1. Send GET requests to server.
Set params:
http://85.255.8.26:8001/<service_name>/cache/<task_id>
2. Get response in JSON format, like:
If RuCaptcha send response to our server:
{'id': <task_id>, 'code': <solve_code>}
or if captcha still not ready:
{'id': <task_id>, 'code': "CAPCHA_NOT_READY"}
If AntiCaptcha send response to our server:
{'taskId': <task_id>, 'message': {......}}
or if captcha still not ready:
{'taskId': <task_id>, 'message': {'taskId': <task_id>, 'status': 'processing'}}
